  getQueens = () => {
    Axios({
      method: "GET",
      url: "http://www.nokeynoshade.party/api/queens/all",
      dataResponse: "json"
    }).then(response => {
      console.log(response);
    })
  }








  render() {
    return (
      <div className="App">
        <Header />
        <h1>BODY CONTENT</h1>
        <Footer />
      </div>
    );
  }
}

export default App;
